import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';
import {
    Button,
    Card,
    Container,
    Row,
    Col
} from 'react-bootstrap';
import logo from './logo-transparent.png';

function Header()
{
    return (
        <div className="Header">
            <Col md="4">
                <img className="header-logo" src={logo} alt="Logo" width="100" height="200" />
            </Col>
            <Col md="8">
                <nav>
                    <Link to="/">Home</Link>
                    <Link to="/services">Our Services</Link>
                    <Link to="/services/get-help">Get Help</Link>
                    <Link to="/about">About Us</Link>
                    <Link to="/souls-family">Little Souls Family</Link>
                    <Link to="/our-story">Our Story</Link>
                </nav>
            </Col>
        </div>
    );
}

export default Header;
